// Footer.jsx

import React from 'react';

// const Footer = () => {
//   return (
//     <footer className="footer py-2 pt-lg-6">

//       <div className="container">
//       <div >
//             <p>&copy; 2023 面小狮 | 42ailife@gmail.com
//                 {/* <a href="/terms">Terms of Service</a> | 
//                 <a href="/privacy">Privacy Policy</a> | 
//                 <a href="/license">Open Source License</a> */}
//                 </p>
//             </div>
//         </div>
//     </footer>
//   );
// };

// export default Footer;


const Footer = () => {
  return (
    <footer className="footer bg-soft py-5 pt-lg-6">
      <figure className="position-absolute top-0 left-0 w-100 d-none d-md-block mt-n3">
        <svg className="fill-soft" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewBox="0 0 1920 43.4" style={{ enableBackground: 'new 0 0 1920 43.4' }} xmlSpace="preserve">
          <path d="M0,23.3c0,0,405.1-43.5,697.6,0c316.5,1.5,108.9-2.6,480.4-14.1c0,0,139-12.2,458.7,14.3 c0,0,67.8,19.2,283.3-22.7v35.1H0V23.3z"></path>
        </svg>
      </figure>
      <div className="container">
        <div className="row justify-content-between">
          <div className="col-md-4">
            <p>智能面试小助理，帮你高效演练入学面试。</p>
            <ul className="social-buttons mb-5 mb-lg-0">
              <li>
                <a href="https://twitter." aria-label="twitter social link" className="icon icon-md icon-twitter mr-3">
                  <span className="fab fa-twitter"></span>
                </a>
              </li>
              <li>
                <a href="https://www.facebook" className="icon icon-md icon-facebook mr-3" aria-label="facebook social link">
                  <span className="fab fa-facebook"></span>
                </a>
              </li>
              <li>
                <a href="https://github." aria-label="github social link" className="icon icon-md icon-github mr-3">
                  <span className="fab fa-github"></span>
                </a>
              </li>
              <li>
                <a href="https://dribbble.com/themesberg" className="icon icon-md icon-dribbble" aria-label="dribbble social link">
                  <span className="fab fa-dribbble"></span>
                </a>
              </li>
            </ul>
          </div>
          <div className="col-6 col-md-2 mb-5 mb-lg-0">
            <span className="h5">面小狮</span>
            <ul className="footer-links mt-2">
              <li><a target="_blank" href="/blog">Blog</a></li>
              <li><a target="_blank" href="/quiz">Practice</a></li>
              <li><a target="_blank" href="/about">About Us</a></li>
              <li><a target="_blank" href="/contact">Contact Us</a></li>
            </ul>
          </div>
          <div className="col-12 col-md-4 mb-5 mb-lg-0">
            <span className="h5 mb-3 d-block">Subscribe</span>
            <form action="#">
              <div className="form-row mb-2">
                <div className="col-12">
                  <input type="email" className="form-control mb-2" placeholder="example@company.com" name="email" aria-label="Subscribe form" required />
                </div>
                <div className="col-12">
                  <button type="submit" className="btn btn-dark shadow-soft btn-block" data-loading-text="Sending">
                    <span>Subscribe</span>
                  </button>
                </div>
              </div>
            </form>
            <p className="text-muted font-small m-0">No spam. Pinky swear.</p>
          </div>
        </div>
        <hr className="bg-light my-2" />
        <div className="row pt-2 pt-lg-5">
          <div className="col mb-md-0">
            <a href="https://themesbe" target="_blank" className="d-flex justify-content-center">
              <img src="./static/assets/img/themesberg.svg" height="25" className="mb-3" alt="面小狮Logo" />
            </a>
            <div className="d-flex text-center justify-content-center align-items-center" role="contentinfo">
              <p className="font-weight-normal font-small mb-0">Copyright © 面小狮 2023-<span className="current-year">2023</span>. All rights reserved.</p>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
